import React, {useState} from 'react';
import { Dialog, DialogTitle, DialogContent, TextField, List, ListItem } from '@material-ui/core';
import Style from './styles';

const Modal = props => {
	const classes = Style();

	const [search, setSearch] = useState({
		buscar: '',
		resultados: []
	});

	const Changer = e => {
		setSearch({
				...buscar,
				buscar: e.target.value
		});
	}

	return (
		<Dialog onClose={() => props.setDialog(false)} open={props.dialog}>
	      <DialogTitle>
	      	Agregar Nueva Ubicacion
	      </DialogTitle>
	      <DialogContent dividers>
	      	<div className={classes.modal}>
	      		<TextField 
	      		className={classes.input} 
	      		type="search"
	      		name="buscar" 
	      		value={search.buscar}
	      		onChange={Changer}
	      		label="Buscador..." />
		      	<List>
			       { search.resultados.map( resultado => (
			       		<ListItem>hola</ListItem>
			       ))}
		       	</List>
	      	</div>
	      </DialogContent>
	    </Dialog>
	);
}

export default Modal;
